  \"ldeo-carbonate-data-caco3-percentages-for-328-sediments-cores-principally-from-the-atlantic-oc\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"LDEO Carbonate data were compiled under
  the direction of A. Esmay and W.F. Ruddiman at the Lamont-Doherty Earth Observatory
  of Columbia University. Data include CaCO3 percentages by interval down core for
  328 sediments cores, principally from the Atlantic ocean. Data are derived primarily
  from two sources. First, cores analyzed during the CLIMAP project to generate stratigraphic
  control on cores from key deep-sea regions. Second, cores analyzed using almost
  entirely National Science Foundation funds, but through smaller grants to individuals
  and institutions. On average, cores span intervals of time of 100,000 to 200,000
  years and have been analyzed at time steps of a few thousand years. Several cores
  span only the last deglaciation; a few cores cover much longer intervals, up to
  3 million years. Samples are annotated as either bulk sediment, or fine-fraction.
  Data are available for free download. Data were originally submitted to NOAA's National
  Geophysical Data Center (NGDC) for archive and were subsequently transferred to
  NOAA's National Climatic Data Center (NCDC) Paleoclimatology Group for stewardship.\",\n\t\"license_title\":
